import React, { Component } from 'react';

export default class Render extends Component{
    constructor(props){
        super(props);
        this.state = {mensajeRender : 'Mensaje inicial Render'};
    }

    componentWillMount(){
        console.log('componentWillMount Render');
    }

    render(){
        console.log('componentWillMount Render');
        return 'Soy el metodo render';
    }
}
